import PropTypes from "prop-types";

const Item = (props) => {
  const { name, money } = props;

  const status = money < 0 ? "LessThan 0" : "MoreThan 0";

  return (
    <li>
      {name} {status}
      <span>{money}</span>
    </li>
  );
};

Item.propTypes = {
  name: PropTypes.string.isRequired,
  money: PropTypes.number.isRequired,
};

export default Item;
